Yes! Horses have been shown to associate positive emotions and reactions to laughter. Studies like this one (

 https://scholar.google.com/scholar?hl=en&as_sdt=0%2C47&q=horses+human+facial+expressions&btnG=#d=gs_qabs&u=%23p%3D-pWSLqfzORcJ

